INSERT INTO Workouts VALUES(173, '4/12/23', '10003', '3', '3', '225', '225', '30', '100015', '"Position thumb to top part of bar, make sure shoulders are a bit raised and tight and bring chest to bar, from there angle feet out keep elbows close then take deep breath to grip underneath bar. When under bar, setup angles out feet, fix head position looking up, deep breathe, keep elbows close and squeeze abdominals down, once descent to bottom, descent again lower then push off"');
INSERT INTO Workouts VALUES(174, '4/12/23', '10004', '3', '5', '185', '195', '25', '100015', '"wider stance point feet 45 angle, make sure inner legs and heel is engaged, keep within same breath and donâ€™t leave butt on too much of bench. Started bench first because squat bar not open"');
