## Workout Project - Preparing/Processing Data

/* Create Workouts Table */
CREATE TABLE Workouts (
Workout_ID INT Primary KEY,
Date Date,
Exercise_ID INT,
Sets INT,
Repetitions INT,
Lowest_Weight INT,
Highest_Weight INT,
Time_Spent_Mins INT,
Week_ID INT,
Comments VARCHAR(1000)
);

SELECT * FROM Workouts;


/* Create Exercise Table */
CREATE TABLE Exercise (
Exercise_ID INT PRIMARY KEY,
name VARCHAR(60),
type VARCHAR(60),
category VARCHAR(60)
);

SELECT * FROM Exercise;


SELECT * FROM Exercise;

/* Create Week Table */
CREATE TABLE Week (
Week_ID INT PRIMARY KEY,
Start_Date Date,
End_Date Date
);

SELECT * FROM Week;


SELECT * FROM Week;

/* JOIN Workouts, Exercise, and Week */
SELECT Workouts.Workout_ID, Workouts.Date, Exercise.Name, Exercise.Type, Exercise.Category, Workouts.Sets, Workouts.Repetitions, Workouts.Lowest_Weight, Workouts.Highest_Weight, Workouts.Time_Spent_mins, Week.Start_Date, Week.End_Date, Workouts.Comments
FROM Workouts
FULL JOIN Exercise ON Workouts.Exercise_ID = Exercise.Exercise_ID
FULL JOIN Week ON Workouts.Week_ID = Week.Week_ID;
